import React, { Component } from 'react';
import '../css/Layout.css';
import "antd/dist/antd.css";
import { Icon } from 'antd';
import {Nav , Navbar,Form,Button,FormControl,NavDropdown, Container } from 'react-bootstrap';

class Layout extends Component {

    render() {

        return (
            <div className="hihi">
                <Container>
                    <Navbar bg="light" expand="lg">
                        <Navbar.Brand href="#home">
                            <img className="d-inline-block align-top" width="65px"
            height="70px" src="https://res.cloudinary.com/aptech-fpt/image/upload/v1549933837/logo-nal.png"></img>
                        </Navbar.Brand>

                        <Navbar.Toggle className="haha" aria-controls="basic-navbar-nav" />
                        

                    </Navbar>

                </Container>
            </div>
        );
    }
}
export default Layout;
